import React, { Component } from 'react';
import { ComposableMap, Geographies, Geography, Marker } from 'react-simple-maps';

const geoUrl = 'https://raw.githubusercontent.com/seabysalt/maps/master/maps.json';

const markers = [
  {
    markerOffset: -30,
    name: "San Francisco",
    coordinates: [-58.3816, -34.6037]
  },
  { markerOffset: 15, name: "Houston", coordinates: [-68.1193, -16.4897] },
  { markerOffset: 15, name: "Lyon", coordinates: [-47.8825, -15.7942] },
  { markerOffset: 15, name: "Salamanca", coordinates: [-70.6693, -33.4489] },
  { markerOffset: 15, name: "Munich", coordinates: [-74.0721, 4.711] },
  { markerOffset: 15, name: "Dodoma", coordinates: [-78.4678, -0.1807] },
  { markerOffset: 15, name: "London", coordinates: [-78.4678, -0.1807] },
];

export default class Map extends Component {
	render() {
		return (
			<div>
				<ComposableMap>
					<Geographies geography={geoUrl} fill="#D6D6DA" stroke="#FFFFFF" strokeWidth={0.5}>
						{({ geographies }) => geographies.map((geo) => <Geography key={geo.rsmKey} geography={geo} />)}
					</Geographies>
					<Marker coordinates={[-74.006, 40.7128]}>
						<circle r={8} fill="#F53" />
					</Marker>
				</ComposableMap>
			</div>
		);
	}
}
